public class ResourceManagementTest {

    @Test
    public void testResourceReallocationUnderLoad() throws Exception {
        // Step 0: Configure the resource management system with strict capacity limits
        GenericObjectPoolConfig poolConfig = new GenericObjectPoolConfig();
        poolConfig.setMaxTotal(6);
        poolConfig.setMaxWait(Duration.ofSeconds(5));

        // Create a mock factory for testing
        PooledObjectFactory<String> factory = new PooledObjectFactory<String>() {
            @Override
            public void activateObject(PooledObject<String> pooledObject) throws Exception {}

            @Override
            public void destroyObject(PooledObject<String> pooledObject) throws Exception {}

            @Override
            public PooledObject<String> makeObject() throws Exception {
                return new GenericObjectPool.PooledObject<>("test");
            }

            @Override
            public void passivateObject(PooledObject<String> pooledObject) throws Exception {}

            @Override
            public boolean validateObject(PooledObject<String> pooledObject) {
                return true;
            }
        };

        // Create the pool
        ObjectPool<String> pool = new GenericObjectPool<>(factory, poolConfig);

        // Step 1: Establish six concurrent request threads
        CountDownLatch startLatch = new CountDownLatch(1);
        CountDownLatch doneLatch = new CountDownLatch(6);

        Thread[] threads = new Thread[6];

        // Create threads for three categories with uneven load
        for (int i = 0; i < 1; i++) {
            threads[i] = new Thread(() -> {
                try {
                    startLatch.await();
                    pool.borrowObject();
                } catch (Exception e) {
                    e.printStackTrace();
                } finally {
                    doneLatch.countDown();
                }
            });
        }

        for (int i = 1; i < 3; i++) {
            threads[i] = new Thread(() -> {
                try {
                    startLatch.await();
                    pool.borrowObject();
                } catch (Exception e) {
                    e.printStackTrace();
                } finally {
                    doneLatch.countDown();
                }
            });
        }

        for (int i = 3; i < 6; i++) {
            threads[i] = new Thread(() -> {
                try {
                    startLatch.await();
                    pool.borrowObject();
                } catch (Exception e) {
                    e.printStackTrace();
                } finally {
                    doneLatch.countDown();
                }
            });
        }

        // Step 2: Exhaust the system's capacity
        String[] exhaustedResources = new String[6];
        for (int i = 0; i < 6; i++) {
            exhaustedResources[i] = pool.borrowObject();
        }

        // Start the waiting threads
        for (Thread thread : threads) {
            thread.start();
        }

        startLatch.countDown();

        // Step 3: Allow threads to enter waiting state
        Thread.sleep(1000); // Brief moment for threads to enter waiting state

        GenericObjectPoolMXBean mxBean = (GenericObjectPoolMXBean) pool;
        int numWaiters = mxBean.getNumWaiters();
        assertTrue(numWaiters > 0, "Threads should be in waiting state");

        // Step 4: Release and clear resources from the first exhausted category
        pool.close();

        // Step 5: Verify that at least one request is served
        // Simulate verification by checking if threads are still running
        boolean atLeastOneServed = false;
        for (Thread thread : threads) {
            if (!thread.isAlive()) {
                atLeastOneServed = true;
                break;
            }
        }
        assertTrue(atLeastOneServed, "At least one request should be served");

        // Step 6: Repeat for the second exhausted category
        pool.close();

        // Step 7: Allow additional waiting requests to be served
        Thread.sleep(1000);

        // Step 8: Verify additional requests are served
        boolean additionalServed = false;
        for (Thread thread : threads) {
            if (!thread.isAlive()) {
                additionalServed = true;
                break;
            }
        }
        assertTrue(additionalServed, "Additional requests should be served");

        // Step 9: Release and clear resources from the third exhausted category
        pool.close();

        // Step 10: Allow remaining waiting requests to be served
        Thread.sleep(1000);

        // Step 11: Confirm all threads have completed
        assertTrue(doneLatch.await(5, TimeUnit.SECONDS), "All threads should complete");

        // Step 12: Verify outcomes using standard boolean assertions
        assertTrue(true, "Test completed successfully");
    }
}

