import static org.junit.jupiter.api.Assertions.assertTrue;

public class GenericKeyedObjectPoolConcurrentTest {

    @Test
    public void testPoolCapacityReuseUnderConcurrentLoad() throws Exception {
        // Step 0: Configure Generic Keyed Object Pool
        GenericKeyedObjectPoolConfig config = new GenericKeyedObjectPoolConfig();
        config.setMaxTotalPerKey(6);
        config.setMaxTotal(6);

        KeyedPooledObjectFactory<String, Object> factory = new KeyedPooledObjectFactory<String, Object>() {
            @Override
            public Object makeObject(String key) throws Exception {
                return new Object();
            }

            @Override
            public boolean validate(String key, Object obj) {
                return true;
            }

            @Override
            public void activateObject(String key, Object obj) throws Exception {}

            @Override
            public void passivateObject(String key, Object obj) throws Exception {}

            @Override
            public void destroyObject(String key, Object obj) throws Exception {}

            @Override
            public PooledObject<Object> makeObject(String key) throws Exception {
                return new DefaultPooledObject<>(new Object());
            }

            @Override
            public boolean validateObject(String key, PooledObject<Object> pooledObject) {
                return true;
            }

            @Override
            public void activateObject(String key, PooledObject<Object> pooledObject) throws Exception {}

            @Override
            public void passivateObject(String key, PooledObject<Object> pooledObject) throws Exception {}

            @Override
            public void destroyObject(String key, PooledObject<Object> pooledObject) throws Exception {}
        };

        GenericKeyedObjectPool<String, Object> pool = new GenericKeyedObjectPool<>(factory, config);

        // Step 1: Create collection to hold six test threads
        List<Thread> threadCollection = new ArrayList<>();

        // Step 2: Create helper runnable that attempts to borrow from pool using assigned key
        AtomicInteger completedThreads = new AtomicInteger(0);
        Runnable borrowRunnable = new Runnable() {
            @Override
            public void run() {
                try {
                    Object obj = pool.borrowObject("three");
                    completedThreads.incrementAndGet();
                    pool.returnObject(obj);
                } catch (Exception e) {
                    e.printStackTrace();
                }
            }
        };

        // Step 3: Exhaust pool capacity by borrowing two objects each from keys four, five, and six
        Object four = pool.borrowObject("four");
        Object four2 = pool.borrowObject("four");
        Object five = pool.borrowObject("five");
        Object five2 = pool.borrowObject("five");
        Object six = pool.borrowObject("six");
        Object six2 = pool.borrowObject("six");

        // Pause briefly to ensure the pool reaches full capacity
        Thread.sleep(1000);

        // Create and start six waiting threads
        for (int i = 0; i < 6; i++) {
            Thread thread = new Thread(borrowRunnable);
            threadCollection.add(thread);
            thread.start();
        }

        // Step 4: Start all six waiting threads (already started above)

        // Step 5: Pause to allow threads to enter waiting state
        Thread.sleep(1000);

        // Step 6: Return both objects borrowed under key four to pool
        pool.returnObject(four);
        pool.returnObject(four2);

        // Step 7: Invoke clear method on key four
        pool.clear("four");

        // Step 8: Pause to allow capacity reallocation
        Thread.sleep(1000);

        // Step 9: Verify at least one of three threads waiting on key three has completed
        assertTrue(completedThreads.get() >= 1, "At least one thread should have completed");

        // Step 10: Return both objects borrowed under key five to pool
        pool.returnObject(five);
        pool.returnObject(five2);

        // Step 11: Invoke clear method on key five
        pool.clear("five");

        // Step 12: Pause to allow capacity reallocation
        Thread.sleep(1000);

        // Step 13: Return both objects borrowed under key six to pool
        pool.returnObject(six);
        pool.returnObject(six2);

        // Step 14: Invoke clear method on key six
        pool.clear("six");

        // Step 15: Pause to allow capacity reallocation
        Thread.sleep(1000);

        // Step 16: Assert none of six threads remain alive
        for (Thread thread : threadCollection) {
            assertTrue(!thread.isAlive(), "Thread should have completed");
        }

        // Teardown steps
        // Step 17: Retrieve pool's JMX name
        ObjectName jmxName = ((BaseGenericObjectPool<?, ?>) pool).getJmxName();

        // Step 18: Clear all pooled objects
        pool.clear();

        // Step 19: Close pool
        pool.close();

        // Step 20: Nullify pool and factory references
        pool = null;
        factory = null;

        // Step 21: Query platform MBean server for remaining registered pool instances
        MBeanServer mBeanServer = ManagementFactory.getPlatformMBeanServer();
        List<ObjectName> remainingInstances = new ArrayList<>();
        try {
            remainingInstances.addAll(mBeanServer.queryNames(jmxName, null));
        } catch (Exception e) {
            e.printStackTrace();
        }

        // Step 22: Assert no pools remain registered
        assertTrue(remainingInstances.isEmpty(), "No pools should remain registered");

        // Step 23: Unregister any found instances and build diagnostic message
        StringBuilder diagnosticMessage = new StringBuilder();
        for (ObjectName name : remainingInstances) {
            try {
                mBeanServer.unregisterMBean(name);
                diagnosticMessage.append("Unregistered: ").append(name).append("\n");
            } catch (Exception e) {
                diagnosticMessage.append("Failed to unregister: ").append(name).append("\n");
            }
        }

        if (diagnosticMessage.length() > 0) {
            System.out.println(diagnosticMessage.toString());
        }
    }
}

