            public void passivateObject(PooledObject<Object> pooledObject) throws Exception {
                throw new Exception("Simulated passivation failure");
            }

            @Override
            public void destroyObject(PooledObject<Object> pooledObject) throws Exception {
                throw new Exception("Simulated destruction failure");
            }

            @Override
            public boolean validateObject(PooledObject<Object> pooledObject) {
                return false;
            }
        };

        // Step 1: Initialize the resilient factory wrapper using only the simulated factory without custom parameters
        ResilientPooledObjectFactory<Object, Object> resilient_factory = new ResilientPooledObjectFactory<>(simulated_factory);
        GenericObjectPool<Object> pool = new GenericObjectPool<>(simulated_factory);
        resilient_factory.setPool(pool);

        // Step 2: Verify the monitoring process is not actively running
        boolean monitoring_status = resilient_factory.isMonitorRunning();

        // Step 3: Verify the automatic replenishment process is inactive
        // Using activateObject as a proxy for checking replenishment status
        boolean replenishment_status = false;
        try {
            PooledObject<Object> pooledObject = new PooledObject<Object>() {
                @Override
                public Object getObject() {
                    return new Object();
                }

                @Override
                public void invalidate() {}

                @Override
                public boolean startEvictionTest() {
                    return false;
                }

                @Override
                public void use() throws Exception {
                    throw new Exception("Simulated use failure");
                }
            };
            simulated_factory.activateObject(pooledObject);
        } catch (Exception e) {
            replenishment_status = true;
        }

        // Step 4: Confirm the system adopts standard configuration values
        Duration timeBetweenChecks = resilient_factory.getTimeBetweenChecks();
        Duration defaultTimeBetweenChecks = ResilientPooledObjectFactory.getDefaultTimeBetweenChecks();

        // Step 5: Check that the event tracking log starts empty
        List<ResilientPooledObjectFactory.MakeEvent> makeObjectLog = resilient_factory.getMakeObjectLog();
        int logSize = resilient_factory.getLogSize();

        // Step 6: Assert that all default settings match their expected baseline values
        Assertions.assertEquals(false, monitoring_status);
        Assertions.assertEquals(true, replenishment_status);
        Assertions.assertEquals(defaultTimeBetweenChecks, timeBetweenChecks);
        Assertions.assertEquals(0, logSize);

        // Step 8: Modify the monitoring interval to a shorter duration
        resilient_factory.setTimeBetweenChecks(Duration.ofMillis(100));
        Duration updated_monitoring_interval = resilient_factory.getTimeBetweenChecks();

        // Step 9: Verify the system accepts the new configuration values
        Assertions.assertEquals(Duration.ofMillis(100), updated_monitoring_interval);

        // Step 10: Clean up resources used by the resilient factory wrapper
        pool.close();
    }
}

